import { Component, OnInit, OnDestroy } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { HttpResponse } from '@angular/common/http';
import { NgbActiveModal } from '@ng-bootstrap/ng-bootstrap';
import { AlertService } from 'app/core/util/alert.service';
import { EventManager } from 'app/core/util/event-manager.service';
import { Resource } from '../resource/resource.model';
import { UserService } from './user.service';
import { UserAssignPopupService } from './user-assign-popup.service';

@Component({
  selector: 'ic-user-assign-roles-dialog',
  templateUrl: './user-assign-roles-dialog.component.html',
})
export class UserAssignRolesDialogComponent implements OnInit {
  isSaving?: boolean;

  subjectId?: string;
  searchedRoles: Resource[] = [];
  chooseedRoles: Resource[] = [];
  userId?: string;
  previousUrl?: string;

  constructor(
    public activeModal: NgbActiveModal,
    private alertService: AlertService,
    private userService: UserService,
    private eventManager: EventManager,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.isSaving = false;
    this.userId = this.router.url.substring(this.router.url.lastIndexOf('/') + 1);
    this.previousUrl = 'admin/acm/ic-user/' + this.userId;
  }

  clear(): void {
    this.activeModal.dismiss('cancel');
    this.backToPrevious();
  }

  assign(): void {
    this.isSaving = true;
    if (this.chooseedRoles.length > 0) {
      this.userService.assignRoles(this.subjectId, this.chooseedRoles).subscribe(() => {
        this.activeModal.dismiss('cancel');
        this.backToPrevious();
        this.eventManager.broadcast({ name: 'assignedRoleListModification', content: 'OK' });
      });
    }
  }

  searchUnAssignRoles(event: any): void {
    this.userService
      .searchUnAssignedRoles({
        subjectId: this.subjectId,
        roleName: event.query,
        page: 0,
        size: 1000,
        sort: null,
      })
      .subscribe(
        (res: HttpResponse<any>) => {
          this.searchedRoles = res.body;
        },
        (res: HttpResponse<any>) => this.onError(res.body)
      );
  }

  private onError(error: any): void {
    this.alertService.addAlert({ type: 'danger', translationKey: error.message });
  }

  private backToPrevious(): void {
    setTimeout(() => {
      this.router.navigate([this.previousUrl]);
    }, 0);
  }
}

@Component({
  selector: 'ic-user-assign-roles-popup',
  template: '',
})
export class UserAssignRolesPopupComponent implements OnInit, OnDestroy {
  routeSub: any;

  constructor(private route: ActivatedRoute, private userAssignPopupService: UserAssignPopupService) {}

  ngOnInit(): void {
    this.routeSub = this.route.params.subscribe(params => {
      if (params['id']) {
        this.userAssignPopupService.open(UserAssignRolesDialogComponent as Component, params['id']);
      }
    });
  }

  ngOnDestroy(): void {
    this.routeSub.unsubscribe();
  }
}
<div class="modal-header">
  <h4 class="modal-title" id="myGroupLabel">Assign Roles to User</h4>
  <button type="button" class="close" data-bs-dismiss="modal" aria-hidden="true" (click)="clear()">&times;</button>
</div>

<div class="modal-body">
  <div class="rounded-pill row">
    <label class="col-sm-3 form-control-label">Search By Role Name</label>
    <div class="col-sm-9">
      <p-autoComplete
        class="ui-fluid"
        [(ngModel)]="chooseedRoles"
        name="chooseedRoles"
        [suggestions]="searchedRoles"
        (completeMethod)="searchUnAssignRoles($event)"
        field="resourceName"
        [multiple]="true"
      ></p-autoComplete>
    </div>
  </div>
</div>

<div class="modal-footer">
  <button
    type="button"
    [disabled]="isSaving || !chooseedRoles || chooseedRoles.length === 0"
    class="btn btn-primary btn-sm"
    (click)="assign()"
  >
    <fa-icon [icon]="'save'"></fa-icon>&nbsp;<span>Assign Roles</span>
  </button>
  <button type="button" class="btn btn-secondary btn-sm" data-bs-dismiss="modal" (click)="clear()">
    <fa-icon [icon]="'ban'"></fa-icon>&nbsp;<span icTranslate="entity.action.cancel">Cancel</span>
  </button>
</div>
